INSERT INTO dish VALUES (1, "Caesar Salad", 'a tossed salad made of romaine, garlic, anchovies, and croutons and dressed with olive oil, coddled egg, lemon juice, and grated cheese. ', 1,'https://www.seriouseats.com/thmb/ugNLQE6hZcoZx0Tzu780h1L3lfc=/3750x3750/smart/filters:no_upscale()/the-best-caesar-salad-recipe-06-40e70f549ba2489db09355abd62f79a9.jpg');
INSERT INTO dish VALUES (2, "Flaming Moe", 'The signature specialty drink of Springfield', 1,'https://images.squarespace-cdn.com/content/v1/56b92fd6f8508249cabeff0a/1492450769102-27IA53NVPAV9FW1R20F2/flaming-moe-drink.jpg');
INSERT INTO dish VALUES (3, "Chicken Wings", 'Fresh chicken wings that comes with a side dip of your choice: Hot Buffalo, Honey BBQ or sweet Asian Chili sauce.', 1,'https://olo-images-live.imgix.net/cd/cd6a3b2ae59d4cbdabcee5ccbc76874b.jpeg?auto=format%2Ccompress&q=60&cs=tinysrgb&w=1200&h=800&fit=fill&fm=png32&bg=transparent&s=566a06b1f7f88235bc66bc09bae0f733');
INSERT INTO dish VALUES (4, "Draft Beer", 'Choose from Duff or Duff Lite.', 1, 'https://media-cdn.tripadvisor.com/media/photo-s/14/3d/2b/9e/draft-beer-poured-perfectly.jpg');
INSERT INTO dish VALUES (5, "Mr.Teeny", 'Lemonade, pineapple juice, and Blue Cura√ßao syrup. Freshly prepared and served with a specialty garnish.', 1, 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSwft6sLJuasi-TNa7gxs9SPPrfK7ej1F8m8g&usqp=CAU');
INSERT INTO dish VALUES (6, "Bacon Cheeseburger", 'A handcrafted all-beef patty topped with two slices of American cheese and two strips of Applewood-smoked bacon. Served with lettuce, tomato, onion and pickles on a Brioche bun with fries.', 1,'https://olo-images-live.imgix.net/dc/dc18e5a0155445a1a18e2983ec91ec19.jpg?auto=format%2Ccompress&q=60&cs=tinysrgb&w=1200&h=800&fit=fill&fm=png32&bg=transparent&s=8310aef0b39c078245d325d3ef89c18b');
INSERT INTO dish VALUES (7, "Birria Tacos", ' Topped with cilantro, onion, a spicy red sauce and a wedge of lime.', 1, 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSMphFzmxR8Q0r93S-atyjYlP5lKWy9PqUokQ&usqp=CAU');
INSERT INTO dish VALUES (8, "Spinach & Artichoke dip", 'Creamy spinach and artichoke dip topped with melted Parmesan cheese. Served with freshly made white corn tortilla chips and our chipotle lime salsa.', 1, 'https://olo-images-live.imgix.net/92/924a7b49593846b190c478d1f56c6aa3.jpeg?auto=format%2Ccompress&q=60&cs=tinysrgb&w=1200&h=800&fit=fill&fm=png32&bg=transparent&s=a21e282623f3de1a3538bd2b31fe146c');
INSERT INTO dish (name, description, bizID, url) VALUES ("Strawberry Balsamic Chicken Salad", 'Mixed greens served with lemon olive oil vinaigrette, tomatoes, red onions and fresh strawberries. Topped with grilled chicken, sliced almonds and balsamic glaze.', 1, 'https://olo-images-live.imgix.net/4d/4d84ae2bdd9344c992b81639e2e0d714.jpeg?auto=format%2Ccompress&q=60&cs=tinysrgb&w=1200&h=800&fit=fill&fm=png32&bg=transparent&s=6810082d7354fd86a3727a6c386f5fad');
INSERT INTO dish (name, description, bizID, url) VALUES ("Fountain Drinks", 'Your choice of Sprite, Coca Cola, Diet Coke, Pepsi, Brisk Iced Tea, and Fanta.', 1, 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSSnBnNmI7bC35S2YAlf8g42KRelukpDEl3JA&usqp=CAU');
INSERT INTO dish (name, description, bizID, url) VALUES ("Egg Salad", 'Chopped eggs stirred in a bowl with mayonnaise, mustard and green onion. Seasoned with salt, pepper and paprika', 1, 'https://imagesvc.meredithcorp.io/v3/mm/image?url=https%3A%2F%2Fstatic.onecms.io%2Fwp-content%2Fuploads%2Fsites%2F43%2F2020%2F05%2F20%2F191517.jpg&w=272&h=272&c=sc&poi=face&q=60');
INSERT INTO dish (name, description, bizID, url) VALUES ("Baby Back Ribs", 'Full Rack. Slow-cooked to fall off the bone tenderness. Slathered with your choice of sauce: - Honey BBQ sauce - Sweet Asian Chili sauce', 1, 'https://olo-images-live.imgix.net/af/af945e19bbbf45c68436edda8a607fce.jpeg?auto=format%2Ccompress&q=60&cs=tinysrgb&w=1200&h=800&fit=fill&fm=png32&bg=transparent&s=a1824dc829e578eebc5660ad94290c48');
INSERT INTO dish (name, description, bizID, url) VALUES ("Spaghetti Aglio e Olio", 'Cooked spaghetti stirred with red pepper flakes, black pepper, salt, olive oil, Italian parsley, toasted garlic, and topped with Parmigiano-Reggiano cheese.', 1,'https://www.thespruceeats.com/thmb/cMQ2N7JmbfCL7RQNj-4inF4KTik=/1959x1562/filters:fill(auto,1)/garlic-spaghetti-aglio-e-olio-recipe-101815-09-94dce8505fbc480ebaf4c43af9e0a06f.jpg');
INSERT INTO dish (name, description, bizID, url) VALUES ("French Onion Soup", 'Prepared with beef stock and caramelized onions. Top with croutons covered in melty Gruyere and Parmesan cheese.', 1,'https://olo-images-live.imgix.net/62/62f925ee6b0d4eb092cf055683f89df1.jpg?auto=format%2Ccompress&q=60&cs=tinysrgb&w=1200&h=800&fit=fill&fm=png32&bg=transparent&s=9dd5c0c650d7157678530f633c0c0eb2');
INSERT INTO dish (name, description, bizID, url) VALUES ("Blue Ribbon Brownie", 'Chunks of dark chocolate, nuts & hot fudge. Two scoops of vanilla ice cream.', 1, 'https://olo-images-live.imgix.net/9e/9e32e2941b5249e484499a9e08516878.jpeg?auto=format%2Ccompress&q=60&cs=tinysrgb&w=1200&h=800&fit=fill&fm=png32&bg=transparent&s=7a75bb3ee5fb64091d655a5d8ec73d17');
INSERT INTO dish (name, description, bizID, url) VALUES ("Classic Broccoli Chicken Alfredo", 'Juicy grilled chicken is served warm on a bed of fettuccine pasta tossed with broccoli and rich Alfredo sauce and topped with Parmesan cheese.', 1, 'https://olo-images-live.imgix.net/30/30d54e38e85e49b3ba650c2414d15be9.jpg?auto=format%2Ccompress&q=60&cs=tinysrgb&w=1200&h=800&fit=fill&fm=png32&bg=transparent&s=b71f68fdea20f8bf24d2a3f05166d0d9');
INSERT INTO dish (name, description, bizID, url) VALUES ("Steak Nachos", 'Steak nachos and beans sprinkled with grated cheese, diced ripe avocado, diced onions, diced tomatoes, and diced jalapenos, sour cream and chopped cilantro.', 1, 'https://imagesvc.meredithcorp.io/v3/mm/image?url=https%3A%2F%2Fimages.media-allrecipes.com%2Fuserphotos%2F3215886.jpg&w=272&h=272&c=sc&poi=face&q=60');
INSERT INTO dish (name, description, bizID, url) VALUES ("Chocolate Cake", 'A slice of cake from the cake factory across the street. (Dont tell them about this)', 1, 'https://imagesvc.meredithcorp.io/v3/mm/image?url=https%3A%2F%2Fstatic.onecms.io%2Fwp-content%2Fuploads%2Fsites%2F43%2F2022%2F04%2F22%2F17981-one-bowl-chocolate-cake-iii-Dianne-1x1-1.jpg&w=272&h=272&c=sc&poi=%5B620%2C880%5D&q=60');
INSERT INTO dish (name, description, bizID, url) VALUES ("Tres Leches (Three Milk Cake)", 'Is a sponge cake soaked in a mixture of three kinds of milk, topped with whipped cream and strawberries (optional).', 1, 'https://dsquaredonuts.com/wp-content/uploads/2020/03/tes1.jpg');
INSERT INTO dish (name, description, bizID, url) VALUES ("Sizzlin' Caramel Apple Blondie", 'Cinnamon apples surround our famous butter pecan blondie topped with vanilla ice cream, sizzled and drizzled with caramel sauce and a sprinkle of candied pecans.', 1, 'https://olo-images-live.imgix.net/19/19df5e32e2d1432e92c49cc5860995de.jpeg?auto=format%2Ccompress&q=60&cs=tinysrgb&w=1200&h=800&fit=fill&fm=png32&bg=transparent&s=ac5e0fcaeb466de0a3a6f8977580e9ff');
